var combo;var do_select=false;var selected_item;function OnClientValueTypeLoadHandler(a){combo=a}if(window.attachEvent){window.attachEvent("onload",initDialog)}else{if(window.addEventListener){window.addEventListener("load",initDialog,false)}}var ArgList=null;function initDialog(){ArgList=parent.window.getDialogInputArgs();for(var d=0;d<ArgList.length;d++){if(ArgList[d]==null){ArgList[d]=""}}var b=document.getElementById("HiddenName");b.value=ArgList[0];if(ArgList[0].length>0){var c=document.getElementById("insertButtonID");c.value="Update Hidden Field";selected_item=ArgList[1];if(selected_item=="mobile_device_id"||selected_item=="mobile_device_model"||selected_item=="mobile_system_version"){if(combo.get_value()!=selected_item){combo.trackChanges();var e=combo.findItemByValue(selected_item);if(e){e.select()}combo.commitChanges()}var a=document.getElementById("default_value");a.value=""}else{var a=document.getElementById("default_value");a.value=ArgList[1];combo.trackChanges();var e=combo.findItemByValue("default_value");if(e){e.select()}combo.commitChanges()}}style=ArgList[2]}function insertButton(){var b=document.getElementById("HiddenName");if(b.value==null||b.value==""){alert("Hidden Name is empty");return}if(!IsValidObjectName(b.value)){alert('Hidden Name can only contain either a letter, number, space or "_" and be 1 to 100 characters long');return}b.value=b.value.replaceAll(" ","_");ArgList[0]=b.value;selected_item=combo.get_value();if(selected_item=="default_value"){var a=document.getElementById("default_value");ArgList[1]=a.value}else{ArgList[1]=selected_item}ArgList[2]=style;parent.window.InsertHiddenFieldCallback(ArgList)};